import React from 'react';

const ItemList = props => {
  return (
    <div className='col s6 m6 l4 '>
      <div className='card hoverable waves-effect waves-block waves-red'>
        <a
          class='waves-effect waves-light btn modal-trigger right'
          href='#modal1'
        >
          <span style={{ fontSize: 20 }}>{props.item.Avail}</span>
        </a>
        <div id='modal1' class='modal'>
          <div class='modal-content'>
            <h4>{props.item.Name}</h4>
          </div>
          <input />
          <div class='modal-footer'>
            <a href='#' class='modal-close waves-effect waves-green btn-flat'>
              Submit
            </a>
          </div>
        </div>

        <div
          className='card-content'
          style={{ cursor: 'pointer' }}
          onClick={props.add}
          id={props.item.Name}
        >
          <span className='card-title' onClick={props.add} id={props.item.Name}>
            {props.item.Name}
          </span>
          <div className='right'>Price : {props.item.Price}</div>
        </div>
      </div>
    </div>
  );
};
export default ItemList;
